import React, { useEffect, useState } from "react";
import "../Css/NavPanel.css";

const NavPanel = () => {
  return (
    <div className="nav-section">
      <div className="nav-option">
        <Link to="/add_gsm"></Link>
      </div>
      <div className="nav-option">
        <Link to="/add_shade"></Link>Add Shade
      </div>
      <div className="nav-option">
        <Link to="/add_high_defects"></Link>No of High Defects
      </div>
      <div className="nav-option">
        <Link to="/pass_fail_status"></Link>Pass Fail Status
      </div>
      <div className="nav-option">
        <Link to="/batch_status"></Link>Batch Status
      </div>
      <div className="nav-option">
        <Link to="/reports"></Link>Report
      </div>
    </div>
  );
};

export default NavPanel;
